tables.table_schema:
CREATE TABLE regression_analysis_data (
	id INT,
	x_value FLOAT,
	y_value FLOAT
);

CREATE TABLE regression_data_points (
  id UUID PRIMARY KEY,
  x_value DOUBLE PRECISION,
  y_value DOUBLE PRECISION,
  data_label TEXT
);

CREATE TABLE regression_results (
  id UUID PRIMARY KEY,
  regression_id UUID,
  equation TEXT,
  r_squared DOUBLE PRECISION
);

CREATE TABLE regression_data_points (
    id INT PRIMARY KEY,
    x_value FLOAT,
    y_value FLOAT
);

CREATE TABLE regression_parameters (
    id INT PRIMARY KEY,
    parameter_name VARCHAR(50),
    parameter_value FLOAT
);

CREATE TABLE regression_results (
    id INT PRIMARY KEY,
    regression_id INT,
    intercept FLOAT,
    slope FLOAT
);

CREATE TABLE DataPoints (
    id UUID PRIMARY KEY,
    x_value FLOAT,
    y_value FLOAT
);

CREATE TABLE ModelParameters (
    id UUID PRIMARY KEY,
    model_name TEXT,
    slope FLOAT,
    intercept FLOAT
);

CREATE TABLE RegressionResults (
    id UUID PRIMARY KEY,
    data_point_id UUID,
    model_id UUID,
    predicted_value FLOAT
);

CREATE TABLE Queries (
    id UUID PRIMARY KEY,
    query TEXT,
    result TEXT
);
